import useFetch from '../../hooks/useFetch'
import './Profile.css'

function Profile() {
  const { username }=  useFetch('http://127.0.0.1:3000/service/users')
  return(
    <div>
      {username.data && 'No Registrado'}
    </div>
  )
}

export default Profile
